import React, { Component } from 'react'

class Header extends Component {
  render() {
    return (
      <div className='navbar navbar-expand-lg navbar-light bg-light justify-content-between'>
        <a class="navbar-brand" href="home">Yas-Kad</a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div className='collapse navbar-collapse' >
          <ul className='navbar-nav mr-auto'>
            <li className='nav-item active'><a class="nav-link" href='home'>Home</a></li>
            <li className='nav-item active'><a class="nav-link" href="services">Services</a></li>
            <li className='nav-item active'><a class="nav-link" href="contact">Contact</a></li>
          </ul>
        </div>

      </div>
    )
  }
}


export default Header;
